/* Modulos de librerías */

/* Componentes */
import Header from "../../Components/Header/Header";
import Footer from "../../Components/Footer/Footer";
import Button from "../../Components/Boton/Button";
import InputField from "../../Components/InputField/InputField";
import AnchorButton from "../../Components/AnchorButton/AnchorButton";

/* Estilos */
import styles from "./Home.module.css";

export default function Home() {
    return (
        <>
          {/*<Header/>*/}
          <Main/>
          {/*<Footer/>*/}
        </>
    );
}

function Main() {
  return (
    <main className={styles["main-container"]}>
      <section className={styles["top-level-section"]}>
        <h1>Inicio de sesión</h1>
        <div className={styles["separator-div"]}>
          <section className = {styles["left-section"]}>
            <h2>Credenciales</h2>
            <form className={styles["form-container"]}>
              <ul>
                <li><InputField id="username-register-form" label="Nombre de usuario" name="username" type="text" placeholder="Usuario"/></li>
                <li><InputField id="password-register-form" label="Contraseña" name="password" type="password" placeholder="Contraseña" /></li>
              </ul>
              <div className={styles["buttons-container"]}>
                <Button type="submit" onClickFunction={(event) => Debug(event, "Click en botón")}/>
                <Button type="disabled" onClickFunction={(event) => Debug(event, "Click en botón")}/>
              </div>
            </form>
          </section>
          <section className={styles["right-section"]}>
            <h2>Bienvenido</h2>
            <p>¿No tienes una cuenta?</p>
            <AnchorButton link="" text="Regístrate"/>
          </section>
        </div>
      </section>
    </main> 
  );
}

// BORRAR, SOLO PARA TESTING.
function Debug(event, msg) {
  event.preventDefault();
  console.log(msg);
}
